import React from "react";
import "./SearchBar.css";
const SearchBar = () => {
  const submitHandler = (events) => {
    events.preventDefault();
  };
  return (
    <React.Fragment>
      <h1>A fresh approach to shopping.</h1>
      <div className="borderTag"></div>
      <div className="searchBar">
        <input type="text" id="header-search" />
        <button type="submit" value={value} onClick={submitHandler} place>
          Submit
        </button>
      </div>
    </React.Fragment>
  );
};

export default SearchBar;
